import   React    from 'react' ;
import "./Birthday.css";

function Birthdays() {
  
  return (
      <div className="outer">
         <div className="main-container">
          <div className="sub-container">
            <h1 className="title"> <span className='people-num'>5</span> birthdays today</h1>
              <div className="person-box">
                <img src="../" alt="person" className="person-img"/>
                <div className="person-info">
                  <h3>rabee khalifa</h3>
                  <h4>25 years old</h4>
                </div>
              </div>
            
            </div>
            
            <button className="clear-btn">Clear All</button>
         </div>

      </div>
  )
}


export default Birthdays;
